import { Switch } from '@mui/material';
import './App.css';
import Login from './components/Login';

function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <Switch>
            <Route exact path="/login" render={<Login></Login>}/>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
